import React, { useState } from "react";

import { TeamStyle } from "./TeamStyle";
import FontP from "../../styles/fontsStyles/fontP";
import FontA from "../../styles/fontsStyles/FontA"
import Fonth2 from "../../styles/fontsStyles/Fonth2"

import home from "../../content/home.json"
import team from "../../content/team.json"


const displayImg = () => {
    return (
        home.map((member) => {
            const { img } = member;
            <img src={img} />
        })
    )
}
const displayTitle = () => {
    return (
        home.map((member) => {
            const { title } = member;
            <Fonth2> {title}</Fonth2>

        })
    )
}

const displayTeam = () => {
    return (
        team.map((member) => {
            const { name, cargo } = member;
            // <FontA target="_blank" href={linkedin}>{name}</FontA>                 
            <FontP> {cargo}</FontP>
        })
    )
}


const Team = props => {
    return (
        <TeamStyle >
            <div className="global" key={i} >
                <div className="colum1" >
                    {displayImg()}
                </div>
                <div className="title">
                    {displayTitle()}
                </div>
                <div className="colum1">
                    <div className="text">
                    {displayTitle()}
                    </div>
                </div>
            </div>


        </TeamStyle>
    );
};

export default Team;
